import React from 'react';
import Header from './components/Header'
import './App.scss';

function App() {
  return (
    <div className="App">

        <Header/>
        <p className="test">
          whatever it works!!!!!!!!!!!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React I did
        </a>

    </div>
  );
}

export default App;
